  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent implements OnInit {
  public title: string;
  public subtitle: string;
  public web: string;

  constructor() { 
      this.title= "Leonel Rebollini";
      this.subtitle = "Desarrollador web";
